import reportWebVitals from './reportWebVitals';
import axios from "axios";

const DATA = [
    {
        "title": "545",
        "unique": 8,
        "completed": false
    },
    {
        "title": "54211",
        "unique": 9,
        "completed": false
    }
]

function refreshList() {
    axios
        .get("/api/todos/").then(resp => {

        console.log(resp.data);
    })
        .catch((err) => console.log(err));

}
